import React, { Component } from "react";

class UserNavBar extends Component {

  render() {
    return (
      <div className="ui red borderless inverted menu">
        <div className="item">
          <div className="ui yellow massive button">Home</div>
        </div>
        <div className="item">
          <div className="ui green massive button">{this.props.user.username}</div>
        </div>
        <div className="right item">
          <div className="ui right blue massive button" onClick={this.handleLogOut}>Log Out</div>
        </div>
      </div>
    );
  }
}

export default UserNavBar;
